CREATE PROCEDURE [dbo].[TestSequenceProcedure] 
AS
BEGIN
	SET NOCOUNT ON;

    INSERT INTO TestSequenceTable (Id, Name, Price, OrderDate) VALUES (NEXT VALUE FOR TestSequence, 'noname', 0, GETDATE());

	UPDATE TestSequenceTable SET Id = NEXT VALUE FOR TestSequence WHERE ID < 10; 

	INSERT TestSequenceTable (Id, Name) SELECT NEXT VALUE FOR TestSequence ,Name FROM TestSequenceTable WHERE Name LIKE N'A%';

	SELECT NEXT VALUE FOR TestSequence, Name, AVG(Price) AS Price FROM TestSequenceTable GROUP BY Name; 

	SELECT NEXT VALUE FOR TestSequence OVER (ORDER BY Name, AVG(Price)) ,Name ,AVG(Price) AS Price FROM TestSequenceTable GROUP BY Name; 

	SELECT NEXT VALUE FOR TestSequence, COUNT(*), SUM(Price) FROM TestSequenceTable;

	SELECT NEXT VALUE FOR TestSequence, Name FROM TestSequenceTable WHERE Name LIKE 'A%' UNION ALL SELECT NEXT VALUE FOR TestSequence ,Name FROM TestSequenceTable WHERE Name LIKE 'C%' 

	SELECT NEXT VALUE FOR TestSequence, NEXT VALUE FOR TestSequence ,* FROM TestSequenceTable; 

	SELECT NEXT VALUE FOR TestSequence OVER (ORDER BY OrderDate) ,'A' + CAST(NEXT VALUE FOR TestSequence OVER (ORDER BY OrderDate) AS VARCHAR(10)) FROM TestSequenceTable;	

	--SELECT NEXT VALUE FOR TestSequence OVER (PARTITION BY Customer ORDER BY OrderDate), * FROM TestSequenceTable;
END

